import NewIncome from "./NewIncome";
import NewExpense from "./NewExpense";

const NewInformation = () => {
  return (
    <div className="container">
      <div className="row">
        <NewIncome />
        <NewExpense />
      </div>
    </div>
  );
};

export default NewInformation;
